SQL:
SELECT
  COUNT(*)
FROM Courses;

SELECT
  COUNT(DISTINCT student_id)
FROM Students;

SELECT
  COUNT(*)
FROM Classes;

SELECT
  COUNT(*)
FROM Departments;

SELECT count(DISTINCT major_id)
FROM Curriculums
WHERE course_id = 'CEA';

SELECT
  class_id
FROM Classes;

SELECT c.course_name
FROM Courses c
WHERE c.course_id NOT IN (SELECT cc.course_id FROM ClassCourse cc WHERE cc.semester = 'SP25');

SELECT course_name
FROM Courses
WHERE course_id NOT IN (SELECT course_id FROM Curriculums WHERE major_id = 'IS');

SELECT start_date
FROM Students
WHERE student_id = 'HE001';

SELECT start_semester
FROM Students
WHERE student_id = 'HE001';

SELECT course_id, course_name
FROM Courses 
WHERE description IS NULL OR description = '';

SELECT major_name
FROM Majors
WHERE major_id NOT IN (SELECT major_id FROM Curriculums WHERE course_id = 'CSI');
